import React from 'react';
import { Link } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';

const Navbar = () => {
  const { isAuthenticated, user, logout } = useAuth();
  return (
    <nav className="bg-blue-700 text-white py-4 shadow">
      <div className="max-w-7xl mx-auto flex items-center justify-between px-4">
        <Link to="/" className="font-bold text-2xl md:text-3xl tracking-tight">Home Rental</Link>
        <div className="space-x-4 flex items-center">
          {!isAuthenticated && (
            <>
              <Link to="/login" className="hover:underline">Login</Link>
              <Link to="/register" className="hover:underline">Sign Up</Link>
            </>
          )}
          {isAuthenticated && user && (
            <>
              <Link to="/dashboard" className="hover:underline">Dashboard</Link>
              <Link to="/rent" className="hover:underline">List Your Property</Link>
              <button onClick={logout} className="ml-2 bg-red-500 hover:bg-red-600 text-white px-3 py-1 rounded">Logout</button>
            </>
          )}
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
